import React from 'react';

function Projects(props) {
    return (
        <div>
            <h2 className="Project-title">Personal Projects</h2>
            <div className="Project-container">
                <div>TravelBook</div>
                <div>Yelp</div>
                <div>Vitamin Water</div>
            </div>
        </div>
    )
}

export default Projects
